import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Col, Row, Container } from 'react-bootstrap';
import plusSign from "./plus512.png"

function App() {
  return (
      <Container className="stage">
        <Row>
          <Col className="col-grey" sm={1}><img className="plus" src={plusSign}/></Col>
          <Col className="col-rice" sm={1}><img className="plus" src={plusSign}/></Col>
          <Col className="col-grey" sm={1}><img className="plus" src={plusSign}/></Col>
        </Row>

        <Row>
          <Col className="col-grey" sm={1}>sm=1</Col>
          <Col className="col-rice" sm={1}>sm=1</Col>
          <Col className="col-grey" sm={1}>sm=1</Col>
        </Row>

        <Row>
          <Col className="col-grey" sm={1}>sm=1</Col>
          <Col className="col-rice" sm={1}>sm=1</Col>
          <Col className="col-grey" sm={1}>sm=1</Col>
        </Row>
      </Container>
  );
}

export default App;
